『あわっ子』はプロの洗車マンも認めるアイテムです。 <br>
<br>
カーウォッシャーあわっ子は、フカフカの天然羊毛と豊富な泡のチカラで、ボディに付着した頑固な汚れを包み込むようにしてかき出します。 <br>
<br>
またブラシ部は特殊な円すい型なので、どんなボディの曲面でもフィットしやすく、手洗い洗車や他の洗車モップと比べ、洗い残しがありません。
<br>
ニュージーランド産の本格羊毛と、天然成分の安心・安全なECOシャンプーが生み出すボリュームたっぷりの泡で、やさしくしっかり洗えます。 <br>
